import React from 'react'
import "../FooterBar/FooterBar.css"
export default function FooterBar() {
    function buttom() {
        return (
            <table className="table">
                <tbody className="tbody">
                    <tr className="tr">
                        <td className="td"></td>
                        <td className="td"><h3>Kanta Husari</h3></td>
                        <td className="td"></td>
                    </tr>
                </tbody>
            </table>
        )
    }
    return (
        < div className="button" >
            {buttom()}
        </div >
    )
}



